import React from "react";
import { HeroName, ImgWrapper, Wrapper } from "./styled";

interface ITeamHeroProps {
  hero: apiService.Character;
}

export default function TeamHero({hero}:ITeamHeroProps){
  return(
    <Wrapper>
      <ImgWrapper style={{backgroundImage:hero.img}}/>
      <HeroName>{hero.name}</HeroName>
    </Wrapper>
  );
}
